import { Stack, TextField, Button } from "@mui/material";
import Game from "./Game";
import Link from "react-router-dom";

const Form = () => {
    return (
        <Stack gap={3} >
            <TextField label="Number of Questions" variant="outlined">Number of Questions</TextField>
            <TextField label="Category" variant="outlined">Category</TextField>
            <TextField label="Difficulty" variant="outlined">Difficulty</TextField>
            <TextField label="Type" variant="outlined">Type</TextField>

            <Link to="/game">
            <Button variant="contained">Start Game</Button>
            </Link>
        </Stack>
    );
};

export default Form;
